4252	2022-08-21 09:35:08.890717+00	<b>Welcome to World KYC</b>, the only platform that allows you to privately authenticate yourself.<br/><br/><p>World KYC has 2 basic levels, allowing members to declare their personal details, get them Verified by World KYC verification. Then members are able to privately share, self-declared or verified information, with each other without disclosing their full information or presenting an ID.</p><br/><br/><h2>Authentication & Verification Levels:<h2><br/><h3>Member registered (Level 1)</h3><br/>Members have registered and been granted a unique World KYC ID. During the process, the email or phone number has been verified but all member details are self-declared and not verified.<br/><br/><h3>Member Authentication (Level 2) </h3><br/>The member has been authenticated by a World KYC agent and been reviewed by an AML trained professional. The Member has been authenticated, matching at a minimum your ID to your selfie holding your ID. At this level World KYC did not attempt to verify your address. Your address is self-reported and not authenticated.<br/><br/><p>For available products and payment please visit: <a href="https://www.worldkyc.com/en/shop" target="_blank">https://www.worldkyc.com/en/shop</a><br/></p>
